let { setValue, getValue, setFilling, setAnimating, startAnimation, stopAnimation } = ggbApplet;
let intervalChecker = null;

let game = {
    num: new Proxy([5, 7, 8, 7], {
        get: (_, pos) => getValue("num" + (Number(pos) + 1)),
        set: (_, pos, newVal) => setValue("num" + (Number(pos) + 1), newVal)
    }),
    checkmark: new Proxy(Array(4), {
        set: (_, pos, newVal) => setValue("checkMark" + (Number(pos) + 1), newVal)
    }),
    hiddenMax: 2.7,
    frameTime: 100,
    answer: 0,
    get totalSteps() { return getValue("steps") },
    set totalSteps(value) { setValue("steps", value) },
    get firemanStep() { return getValue("firemanStep") },
    set firemanStep(value) { setValue("firemanStep", value) },
    get carAnimation() { return getValue("carAnimation") },
    set carAnimation(value) { setValue("carAnimation", value) },
    get fireAnimation() { return getValue("fireAnimation") },
    set fireAnimation(value) { setValue("fireAnimation", value) },
    get waterAnimation() { return getValue("waterAnimation") },
    set waterAnimation(value) { setValue("waterAnimation", value) },
    get insideBuilding() { return getValue("insideBuilding") },
    set insideBuilding(value) { setValue("insideBuilding", value) },
    get fireIntensity() { return getValue("fireIntensity") },
    set fireIntensity(value) { setValue("fireIntensity", value) }, 
    get hiddenPart() { return getValue("hiddenPart") },
    set hiddenPart(value) { setValue("hiddenPart", value) }
}

function ggbOnInit() { 
    restart();
    intervalChecker = setInterval(() => {
        if (document.querySelector("[aria-label='Graphics View 1']")) return;
        soundFX["fire"].pause();
        soundFX["background"].pause();
        soundFX["siren"].pause();
        soundFX["water"].pause();
        clearInterval(intervalChecker);
    }, 2000);
}

async function runAnimations() {
    let sleepTime = 18 * game.frameTime;
    if (game.answer === 0) return;

    soundFX["background"].loop = true;
    soundFX["background"].play();
    await showBuilding();
    await sleep(game.frameTime);

    soundFX["siren"].play();
    await moveCar();
    await sleep(sleepTime);

    await moveFireman(Math.ceil(game.totalSteps / 2) - 1);
    game.checkmark[0] = true;
    soundFX["fire"].play();
    game.fireIntensity = 1;
    await sleep(sleepTime);

    await moveFireman(game.num[0]);
    game.checkmark[1] = true;
    await sleep(sleepTime / 2);

    soundFX["fire"].play();
    game.fireIntensity = 2;
    await sleep(sleepTime);

    await moveFireman(-game.num[1]);
    game.checkmark[2] = true;
    await sleep(sleepTime / 2);

    soundFX["fire"].play();
    game.fireIntensity = 1;
    await sleep(sleepTime);

    await moveFireman(game.num[2]);
    game.checkmark[3] = true;
    await sleep(sleepTime / 2);

    soundFX["fire"].play();
    game.fireIntensity = 0;
    await sleep(sleepTime);

    await moveFireman(game.num[3]);
    game.checkmark[4] = true;
    await sleep(1.5 * game.frameTime);

    soundFX["water"].loop = true;
    soundFX["water"].play();
    soundFX["background"].pause();
    await animateInsideBuilding();
    soundFX["water"].pause();
    check();
}

async function showBuilding() {
    let hidden = game.hiddenMax;

    while (hidden !== 0) {
        hidden = Math.max(0, hidden - 0.1);
        
        game.hiddenPart = hidden;
        await sleep(game.frameTime);
    }
}

async function moveCar() {
    let percent = 0;
    let animationStep = 0.05;

    while (percent !== 1) {
        game.carAnimation = percent = Math.min(percent + animationStep, 1);
        await sleep(game.frameTime);
    }
}

async function moveFireman(steps) {
    while (steps !== 0) {
        if (steps > 0) {
            game.firemanStep++;
            steps--;
        } else {
            game.firemanStep--;
            steps++;
        }
        await sleep(7 * game.frameTime);
    }
}

async function animateInsideBuilding() {
    let percent = 0;
    let animationStep = 0.015;

    game.fireAnimation = 0;
    game.insideBuilding = true;
    startGeogebraAnimation("waterAnimation");
    await sleep(8 * game.frameTime);
    await fadeOut("fig10");

    while(percent < 1) {
        game.fireAnimation = percent = Math.min(percent + animationStep, 1);
        await sleep(1.5 * game.frameTime);
    }

    await fadeOut("fig11");

    stopGeogebraAnimation("waterAnimation");
    game.waterAnimation = 0;
}

async function fadeOut(figure) {
    let percent = 0;

    while(percent < 1) {
        percent = Math.min(percent + 0.08, 1);
        setFilling(figure, 1 - percent);
        await sleep(game.frameTime);
    }
}

function startGeogebraAnimation(name) {
    setAnimating(name, true);
    startAnimation();
}

function stopGeogebraAnimation(name) {
    setAnimating(name, false);
    stopAnimation();
}

function newGame() {
    game.totalSteps = Math.floor(Math.random() * 8) * 2 + 23;
    let firemanPosition = Math.ceil(game.totalSteps / 2);
    game.num[0] = Math.max(Math.floor(Math.random() * (game.totalSteps - firemanPosition)), 2);
    firemanPosition += game.num[0];
    game.num[1] = Math.max(Math.floor(Math.random() * (game.totalSteps - firemanPosition)), 3);
    firemanPosition -= game.num[1];
    game.num[2] = Math.max(Math.floor(Math.random() * (game.totalSteps - firemanPosition - 1)), 2);
    firemanPosition += game.num[2];
    game.num[3] = game.totalSteps - firemanPosition;

    restart()
}

function restart() {
    game.hiddenPart = game.hiddenMax;
    game.carAnimation = 0;
    game.firemanStep = 1;
    game.fireIntensity = 2;
    game.insideBuilding = false;
    game.checkmark[0] = false;
    game.checkmark[1] = false;
    game.checkmark[2] = false;
    game.checkmark[3] = false;
    game.checkmark[4] = false;
    setFilling("fig10", 1);
    setFilling("fig11", 1);
    setValue("ok", undefined);
    setValue("answer", 0);
}

function setAnswer(value) { game.answer = value; }

function check() {
    if (game.answer === game.totalSteps) setValue("ok", 1);
    else setValue("ok", 0);
}

function sleep(ms) { return new Promise(resolve => setTimeout(resolve, ms)) }

let soundFX = {
    "fire": new Audio("data:audio/mpeg;base64,"),
    "siren": new Audio("data:audio/mpeg;base64,"),
    "water": new Audio("data:audio/mpeg;base64,"),
"background": new Audio("data:audio/mpeg;base64,")
}